import { useState } from "react";
import PlayerList from "./PlayerList";

function Roster({ level, coach, roster_size, teamcity, teammascot, players }) {
    const [isEditing, setIsEditing] = useState(false)

    return (
        <div className="rosters">
            {isEditing ? (
                <div>
                <p className="rosterteamtitle">Team Name: {teamcity} {teammascot}</p>
                <p>Coach Name: {coach}</p>
                <p>Level of Competition: {level}</p>
                <p>Roster Size: {roster_size}</p>
                <p>Players: </p>
                <PlayerList
                    players={players}
                />
                </div>
            ):(
                <div>
                <p className="rosterteamtitle">Team Name: {teamcity} {teammascot}</p>
                <p>Coach Name: {coach}</p>
                <p>Level of Competition: {level}</p>
                <p>Roster Size: {roster_size}</p>
                <p>Players: </p>
                <PlayerList
                    players={players}
                />
                </div>
            )
        }
        </div>
    )}
export default Roster;
